import React from 'react'
import logo from '../../img/logo.png';
import SearchForm from './SearchForm'

function Header() {
    return (
        <header>
            <div className='logo'><img src={logo} alt="Recipes logo"/></div>
            <nav>Nav</nav>
        </header>
    )
}

export default Header
